@import "variable";
$font-size-heading: calc(#{$padding * 8});
$line-hieght-heading: calc(#{$padding * 10.5});
$font-size-sub-heading: calc(#{$padding * 14.5});
$font-size-more-details: calc(#{$padding * 8});
$line-hieght-sub-heading:calc(#{$padding * 18.5});
$line-hieght-more-details:calc(#{$padding * 11.5});
$padding-top-heading:calc(#{$padding * 20});
$padding-bottom-heading:calc(#{$padding * 13});
$padding-bottom-sub-heading:calc(#{$padding * 13.5});
$padding-more-details:calc(#{$padding * 10});
$padding-bottom-more-details:calc(#{$padding * 4.5});

.heading {
  font-family: Lato;
  font-style: normal;
  font-weight: bold;
  font-size: $font-size;
  line-height: $line-hieght-heading;
  color: $color-link;
  text-align: $text-aling-center;
  margin: 0;
  padding-top: $padding-top-heading;
  padding-bottom: $padding-bottom-heading;
}

.heading a {
  text-transform: uppercase;
}

.sub-heading {
  font-family: Lato;
  font-style: normal;
  font-weight: bold;
  font-size: $font-size-sub-heading;
  line-height: $line-hieght-sub-heading;
  text-align: $text-aling-center;
  color: $color-sub-heading;
  margin: 0;
  padding-bottom: $padding-bottom-sub-heading;
}

.more-details {
  margin: 0;
  padding-bottom: $padding-bottom-more-details;
  padding-left: 0;
  padding-right: 0;
  p {
    font-family: Lato;
    font-style: normal;
    font-weight: normal;
    font-size: $font-size-more-details;
    line-height: $line-hieght-more-details;
    text-align: $text-aling-center;
    padding-left: $padding-more-details;
    padding-right: $padding-more-details;
    margin-top: 0;
    color: $color-paragraph;
  }
}

.more-info {
  margin: 0;
}

.interface::after {
  content: "";
  // background-image: url(../img/bg_friendly_user_interface.png);
  background-image: url(../webroot/img/bg_friendly_user_interface.png);
  position: relative;
  background-repeat: no-repeat;
  width: 100vw;
  height: 100vh;
  display: block;
  background-size: 1500px;
  background-position-x: 50%;
  background-position-y: 50%;
}


@media(min-width: 1120px) {
  .heading {
    text-align: $text-aling-left;
    padding-top: 200px;
    padding-bottom: 27px;
  }
  .sub-heading {
    text-align: $text-aling-left;
    padding-bottom: 27px;
  }
  .more-details {
    margin: 0;
    padding-bottom: 54px;
    max-width: 480px;
    max-height: 139px;
    p {
      padding: 0;
      text-align: $text-aling-left;
    }
  }
  .more-info {
    text-align: $text-aling-left;
    padding-bottom: 153px;
  }
  .first-section {
    position: relative;
    overflow: hidden;
  }
  .interface::after {
    content: "";
    // background-image: url(../img/bg_friendly_user_interface.png);
    background-image: url(../webroot/img/bg_friendly_user_interface.png);
    background-repeat: no-repeat;
    display: block;
    background-size: 1800px;
    position: absolute;
    top: 50%;
    left: calc(50% + 240px);
    transform: translate(-50%, -50%);
  }
}
